import React from "react";
import "./App.css";
import { Switch, Route } from "react-router-dom";
import { Home } from "./components/home/Home";
//TV
import {TVDiscover} from "./components/TV/Discover";

export function App() {
  return (
    
    <main>
      <Switch>
        <Route path="/" component={Home} exact />
        <Route path="/discover/tv" component={TVDiscover} />
      </Switch>
    </main>
  );
}

export default App;
